CREATE TABLE Patients (
    PatientID INT PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    DateOfBirth DATE,
    Gender VARCHAR(10),
    Address VARCHAR(255),
    PhoneNumber VARCHAR(15),
    Email VARCHAR(100),
    InsuranceNumber VARCHAR(50),
    BloodType VARCHAR(3)
);

CREATE TABLE Clinics (
    ClinicID INT PRIMARY KEY,
    Name VARCHAR(100),
    Address VARCHAR(255),
    PhoneNumber VARCHAR(16),
    Email VARCHAR(100),
    OpeningHours VARCHAR(50),
    NumberOfDoctors INT,
    NumberOfPatients INT,
    EstablishedYear INT,
    Type VARCHAR(50)
);

CREATE TABLE Doctors (
    DoctorID INT PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    Specialty VARCHAR(100),
    PhoneNumber VARCHAR(16),
    Email VARCHAR(100),
    LicenseNumber VARCHAR(50),
    YearsOfExperience INT,
    ClinicID INT,
    FOREIGN KEY (ClinicID) REFERENCES Clinics(ClinicID)
);

CREATE TABLE Appointments (
    AppointmentID INT PRIMARY KEY,
    PatientID INT,
    DoctorID INT,
    ClinicID INT,
    AppointmentDate DATE,
    AppointmentTime TIME,
    ReasonForVisit VARCHAR(255),
    Status VARCHAR(50),
    FOREIGN KEY (PatientID) REFERENCES Patients(PatientID),
    FOREIGN KEY (DoctorID) REFERENCES Doctors(DoctorID),
    FOREIGN KEY (ClinicID) REFERENCES Clinics(ClinicID)
);

CREATE TABLE Medications (
    MedicationID INT PRIMARY KEY,
    Name VARCHAR(100),
    Manufacturer VARCHAR(100),
    Form VARCHAR(50),
    Strength VARCHAR(50),
    Description TEXT,
    SideEffects TEXT,
    Contraindications TEXT,
    StorageInstructions TEXT,
    Price DECIMAL(10, 2)
);

CREATE TABLE Prescriptions (
    PrescriptionID INT PRIMARY KEY,
    PatientID INT,
    DoctorID INT,
    MedicationID INT,
    Dosage VARCHAR(50),
    Frequency VARCHAR(50),
    StartDate DATE,
    EndDate DATE,
    FOREIGN KEY (PatientID) REFERENCES Patients(PatientID),
    FOREIGN KEY (DoctorID) REFERENCES Doctors(DoctorID),
    FOREIGN KEY (MedicationID) REFERENCES Medications(MedicationID)
);

CREATE TABLE MedicalRecords (
    RecordID INT PRIMARY KEY,
    PatientID INT,
    DoctorID INT,
    VisitDate DATE,
    Diagnosis VARCHAR(255),
    Treatment TEXT,
    Notes TEXT,
    FOREIGN KEY (PatientID) REFERENCES Patients(PatientID),
    FOREIGN KEY (DoctorID) REFERENCES Doctors(DoctorID)
);

CREATE TABLE InsuranceProviders (
    ProviderID INT PRIMARY KEY,
    Name VARCHAR(100),
    Address VARCHAR(255),
    PhoneNumber VARCHAR(16),
    Email VARCHAR(100),
    ContactPerson VARCHAR(100),
    PolicyNumber VARCHAR(50),
    CoverageDetails TEXT,
    PremiumAmount DECIMAL(10, 2),
    ValidityPeriod VARCHAR(50)
);

CREATE TABLE Laboratories (
    LaboratoryID INT PRIMARY KEY,
    Name VARCHAR(100),
    Address VARCHAR(255),
    PhoneNumber VARCHAR(17),
    Email VARCHAR(100),
    OpeningHours VARCHAR(50),
    NumberOfTests INT,
    Accreditation VARCHAR(100),
    EstablishedYear INT,
    Type VARCHAR(50)
);

CREATE TABLE LaboratoryTests (
    TestID INT PRIMARY KEY,
    Name VARCHAR(100),
    Description TEXT,
    PreparationInstructions TEXT,
    NormalRange VARCHAR(50),
    Price DECIMAL(10, 2),
    Duration VARCHAR(50),
    LaboratoryID INT,
    FOREIGN KEY (LaboratoryID) REFERENCES Laboratories(LaboratoryID)
);

CREATE TABLE TestResults (
    ResultID INT PRIMARY KEY,
    TestID INT,
    PatientID INT,
    DoctorID INT,
    ResultDate DATE,
    ResultDetails TEXT,
    Status VARCHAR(50),
    FOREIGN KEY (TestID) REFERENCES LaboratoryTests(TestID),
    FOREIGN KEY (PatientID) REFERENCES Patients(PatientID),
    FOREIGN KEY (DoctorID) REFERENCES Doctors(DoctorID)
);

CREATE TABLE Surgeries (
    SurgeryID INT PRIMARY KEY,
    PatientID INT,
    DoctorID INT,
    SurgeryDate DATE,
    SurgeryType VARCHAR(100),
    DurationMinutes INT,
    Outcome VARCHAR(255),
    Notes TEXT,
    FOREIGN KEY (PatientID) REFERENCES Patients(PatientID),
    FOREIGN KEY (DoctorID) REFERENCES Doctors(DoctorID)
);

CREATE TABLE Vaccines (
    VaccineID INT PRIMARY KEY,
    Name VARCHAR(100),
    Manufacturer VARCHAR(100),
    Type VARCHAR(50),
    StorageInstructions TEXT,
    SideEffects TEXT,
    Price DECIMAL(10, 2),
    ValidityPeriod VARCHAR(50),
    Dosage VARCHAR(50)
);

CREATE TABLE Vaccinations (
    VaccinationID INT PRIMARY KEY,
    PatientID INT,
    VaccineID INT,
    VaccinationDate DATE,
    DoseNumber INT,
    AdministeredBy VARCHAR(100),
    FOREIGN KEY (PatientID) REFERENCES Patients(PatientID),
    FOREIGN KEY (VaccineID) REFERENCES Vaccines(VaccineID)
);

CREATE TABLE MedicalEquipment (
    EquipmentID INT PRIMARY KEY,
    Name VARCHAR(100),
    Manufacturer VARCHAR(100),
    Model VARCHAR(50),
    PurchaseDate DATE,
    WarrantyPeriod VARCHAR(50),
    MaintenanceSchedule TEXT,
    Location VARCHAR(100),
    Status VARCHAR(50),
    Price DECIMAL(10, 2)
);

CREATE TABLE Staff (
    StaffID INT PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    Position VARCHAR(100),
    Department VARCHAR(100),
    PhoneNumber VARCHAR(16),
    Email VARCHAR(100),
    HireDate DATE,
    Salary DECIMAL(10, 2),
    ClinicID INT,
    FOREIGN KEY (ClinicID) REFERENCES Clinics(ClinicID)
);
































